import React from "react";
import "./DetailHotel.css";
import RenderPhoto from "./RenderPhoto";
import DetailHeader from "./DetailHeader";

const DetailHotel = () => {
  return (
    <div>
      <DetailHeader />
      <RenderPhoto />
    </div>
  );
};

export default DetailHotel;
